import React, {Component} from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom';

export default class ProjectDetail extends React.Component{
    constructor(props) {
        super(props);
    }
    render(){
        return(
            <div>
            <section className="project_container_heading">
            <div className="project_detail_description">
                    <h1>Qube Kaffeine &amp; Kitchen.</h1>
                    <p>Web Design &amp; Development</p>
                    <a href="#" className="visit-project">Visit Website</a>
            </div>
            </section>

            <section className="project_container_description">
            <div className="row">
            <div className="col-sm-12 col-md-4">
            <div className="brief">
            <h4>Brief</h4>
            <p>Brochure website to help brand and market the coffee shop by offering an overview of the best prepared coffee in the area, complemented with mediterranean fusion cuisine.</p>
            </div>
            </div>
            <div className="col-sm-12 col-md-4"><h4>Result</h4></div>
            <div className="col-sm-12 col-md-4"><h4>Technologies used</h4></div>
            </div>
            </section>
            </div>
        );
    }
}
